import React from "react";
import Button from "@mui/joy/Button";
import Card from "@mui/joy/Card";
import CardContent from "@mui/joy/CardContent";
import { Input } from "@mui/joy";
import { FormLabel } from "@mui/joy";
import "./styles/JourneyCalculator.css";

const JourneyCalculator = () => {
  return (
    <div className="journey-container">
      <Card sx={{ width: 800, height: 60, borderRadius: 25 }}>
        <CardContent orientation="horizontal">
          <Input placeholder="Distance" variant="soft" />
          <Input placeholder="NO. OF PASSAGERS" variant="soft" />
          <Input placeholder="Type in hereâ€¦" variant="soft" />
          <Button
            style={{ width: "20%", height: "100%" }}
            variant="solid"
            size="md"
            color="primary"
            aria-label="see price"
            sx={{ ml: "auto", alignSelf: "center", fontWeight: 600 }}
          >
            See Price
          </Button>
        </CardContent>
      </Card>
    </div>
  );
};

export default JourneyCalculator;
